  .autocomplete-result {
  list-style: none;
  text-align: left;
  padding: 4px 2px;
  cursor: pointer;
}

.autocomplete-result.isActive,
.autocomplete-result:hover {
  background-color: #173f5f;
  color: white;
}
  .resultsContainer {
      background-color: white;
      width: 100%;
      border: 1px solid darkgray;
      max-height: 25vh;
      overflow-y: scroll;
      text-align: left;
      position: absolute;
      z-index: 9999;
  }



  /* // Form Input // */

  .yesValue {
      color: black;
      font-weight: bolder;
      border-bottom: lightgreen .25px solid;
  }

  .formBorder {
      border-bottom: 2px solid lightgray;
